     onChange={(e)=>{ setNumber2(e.target.value)
    // console.log(number2)
}}
     />
  </div>
  <button className="ui button"
   type="submit"
   onClick={onClickChange()}
   >Add</button>
  </form>
    </div>
};
export default Calculator;
